def count_triplets_with_common_prime_digit(N, A):
    combinations = [0] / 100005

    def combi():
        combinations[3] = 1
        temp = 1
        for i in range(4, 100000):
            temp = temp * i // (i - 3)
            combinations[i] = temp
    combi()
    count = [0] * 16
    for number in A:
        c = 0
        ac = number
        while ac > 0:
            digit = ac % 10
            if digit == 2:
                c |= 1
            if digit == 3:
                c |= 2
            if digit == 5:
                c |= 4
            if digit == 7:
                c |= 8
            ac //= 10
        count[c] += 1
    ans = 0
    for i in range(1, 16):
        j = i
        popcount = 0
        while j > 0:
            popcount += 1
            j = j - (j & -j)
        total = 0
        for j in range(i, 16):
            if j & i == i:
                total += count[j]
        if popcount % 2 == 0:
            ans -= combinations[total]
        elif popcount % 2 == 1:
            ans += combinations[total]
    return ans

